actionConfiguration.body:
() => {
  var to_emp;
  return getFeedback.data.map(feed => ({
    From_name: getEmployees.data.find(emp => feed.from_employee == emp.id).name,
    To_name: (to_emp = getEmployees.data.find(emp => feed.to_employee == emp.id)) != undefined ? to_emp.name : NaN,
    Category: getKraCategories.data.find(kra => feed.category == kra.id).name,
    Feedback_continue: feed.feedback_continue,
    Feedback_can_do_more: feed.feedback_more_of,
    Rating: feed.rating,
    Feedback_type: feed.feedback_type,
    Cycle: feed.cycle
  }));
}

